"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Jet lag (The Basics)",
"    </div>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H93838206\">",
"      <span class=\"h1\">",
"       What is jet lag?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Jet lag is a condition that causes sleep problems, tiredness, and other symptoms. It happens in people who fly across several time zones. The more time zones a person crosses, the more likely he or she is to get jet lag.",
"     </p>",
"     <p>",
"      Jet lag gets better on its own as a person adjusts to the new time zone. But this can take several days. The farther from home a person is, the longer it takes to get over jet lag.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H93838221\">",
"      <span class=\"h1\">",
"       What are the symptoms of jet lag?",
"      </span>",
"      &nbsp;&mdash;&nbsp;The symptoms include:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Sleep problems, such as problems falling or staying asleep",
"       </li>",
"       <li>",
"        Feeling tired or sleepy in the daytime",
"       </li>",
"       <li>",
"        Having trouble thinking, concentrating, or doing normal activities",
"       </li>",
"       <li>",
"        Stomach problems, such as constipation",
"       </li>",
"       <li>",
"        Feeling sick or having less energy than normal",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H93838236\">",
"      <span class=\"h1\">",
"       Should I see a doctor or nurse?",
"      </span>",
"      &nbsp;&mdash;&nbsp;If you think you had jet lag in the past, talk to your doctor or nurse before going on a long airline flight. He or she can help you figure out ways to avoid jet lag.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H93838251\">",
"      <span class=\"h1\">",
"       How can I prevent jet lag?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Here are a few things you can try:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Stay awake and sleep at certain times. This can help your body adjust to the new time zone. For example, you can:",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      <ul class=\"hyphen-block\">",
"       <li>",
"        Stay up until it&rsquo;s dark if you fly west &ndash; Only go to sleep when it gets dark. If you go sightseeing, try to do it during the day.",
"       </li>",
"       <li>",
"        Avoid bright morning light if you fly east &ndash; Go outside as much as possible in the afternoon. If you go sightseeing outdoors, try to do it in the afternoon until your body adjusts to the new time zone.",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Eat meals at mealtime in the new time zone &ndash; For example, if you normally eat lunch at noon, eat at noon in the new time zone (not noon at home).",
"       </li>",
"       <li>",
"        Get some exercise, but not right before you are supposed to go to sleep.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H93838266\">",
"      <span class=\"h1\">",
"       Can supplements or medicines help with jet lag?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. A supplement called &ldquo;melatonin&rdquo; can help with sleep problems from jet lag. Melatonin&nbsp;is a hormone that is naturally made by a gland in the brain. Taking extra melatonin can help your body adjust to a new time zone. You can buy melatonin pills in a store or pharmacy without a prescription. The usual dose is 2 or 3 milligrams after dark each night, about half an hour before you want to go to sleep.",
"     </p>",
"     <p>",
"      If you want to try melatonin, tell your doctor or nurse. He or she can tell you if it is safe for you. If you take",
"      <a class=\"drug drug_patient\" href=\"UTD.htm?33/2/33830?source=see_link\">",
"       warfarin",
"      </a>",
"      (brand names: Coumadin&reg;, Jantoven&reg;) or medicine to help with epilepsy, melatonin might not be safe for you. Tell your doctor or nurse about all medicines and supplements you take, including over-the-counter medicines.",
"     </p>",
"     <p>",
"      The right way to take melatonin depends on whether you are traveling east or west (",
"      <a class=\"graphic graphic_table graphicRef86167 \" href=\"UTD.htm?13/48/14091\">",
"       table 1",
"      </a>",
"      ). You can take melatonin for up to 4 nights in the new time zone. After that, you are not likely to need it.",
"     </p>",
"     <p>",
"      Only adults should take melatonin. Doctors don&rsquo;t know if it helps with jet lag in children. Avoid drinking alcohol while you are taking melatonin.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H93838298\">",
"      <span class=\"h1\">",
"       Does melatonin cause side effects?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Some people have side effects from melatonin. These can include:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Feeling sleepy in the daytime",
"       </li>",
"       <li>",
"        Dizziness or confusion",
"       </li>",
"       <li>",
"        Headache",
"       </li>",
"       <li>",
"        Loss of appetite, nausea, and other stomach problems",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      But these side effects are very similar to jet lag. So doctors are not sure if they are really side effects of melatonin or just jet lag symptoms.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H93838315\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
